package ca.meddavie.inconfidence.domain;

public class Client {

	private long id;
	
	private String efapPolicyNumber;
	
	private String policyNumber;
	
	private String ctlPlan;
	
	private String setupComment;
	
	private String tollFreeNumber;
	
	private String userName;
	
	private String password;
	
	private long vendorId;
	
	
	public Client() {
		// TODO Auto-generated constructor stub
	}


	public long getId() {
		return id;
	}


	public void setId(long id) {
		this.id = id;
	}


	public String getEfapPolicyNumber() {
		return efapPolicyNumber;
	}


	public void setEfapPolicyNumber(String efapPolicyNumber) {
		this.efapPolicyNumber = efapPolicyNumber;
	}


	public String getPolicyNumber() {
		return policyNumber;
	}


	public void setPolicyNumber(String policyNumber) {
		this.policyNumber = policyNumber;
	}


	public String getCtlPlan() {
		return ctlPlan;
	}


	public void setCtlPlan(String ctlPlan) {
		this.ctlPlan = ctlPlan;
	}


	public String getSetupComment() {
		return setupComment;
	}


	public void setSetupComment(String setupComment) {
		this.setupComment = setupComment;
	}


	public String getTollFreeNumber() {
		return tollFreeNumber;
	}


	public void setTollFreeNumber(String tollFreeNumber) {
		this.tollFreeNumber = tollFreeNumber;
	}


	public String getUserName() {
		return userName;
	}


	public void setUserName(String userName) {
		this.userName = userName;
	}


	public String getPassword() {
		return password;
	}


	public void setPassword(String password) {
		this.password = password;
	}


	public long getVendorId() {
		return vendorId;
	}


	public void setVendorId(long vendorId) {
		this.vendorId = vendorId;
	}
	
	

}
